import React from 'react';
import{
    SafeAreaView,
    StyleSheet,
    View
} from 'react-native';

export function UserIdentification(){
    return (
        <SafeAreaView style={styles.container}>
            <view style={styles.content}>
                <View style={styles.form}>
                    <Text style={styles.emoji}>
                        emoji
                    </Text>
                </View>

            </view>

        </SafeAreaView>

    )
}

const styles = StyleSheet.create({
    container: {
        flex

    }

});
